INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(1, 'Jenderal A.H. Nasutionn', , 'Jenderal Anumerta Abdul Haris Nasution, lahir pada 3 Desember 1918 di Kota Hutaraja, Sumatra Utara, adalah salah satu tokoh penting dalam sejarah perjuangan kemerdekaan Indonesia. Lahir dari keluarga sederhana, Nasution tumbuh di lingkungan yang sangat mendukung pendidikan. Ayahnya, Haris Nasution, seorang pegawai negeri, dan ibunya, Siti Mahmudah, memberikan pendidikan yang cukup bagi anak-anak mereka.Nasution mengawali pendidikan dasarnya di Sekolah Rakyat di kampung halamannya, kemudian melanjutkan ke Sekolah Menengah Atas di Medan. Setelah menyelesaikan pendidikannya, Nasution menempuh jenjang pendidikan lebih tinggi di Militaire Academie (Akademi Militer) di Magelang, yang saat itu merupakan pusat pelatihan militer Belanda. Ia lulus pada tahun 1940.Pada masa itu, Indonesia masih berada di bawah penjajahan Belanda, dan meskipun Nasution tergabung dalam tentara kolonial Belanda setelah lulus dari akademi militer, semangat nasionalismenya semakin tumbuh. Ketika Proklamasi Kemerdekaan Republik Indonesia dikumandangkan pada 17 Agustus 1945, Nasution segera beralih bergabung dengan pasukan Indonesia, meninggalkan kesetiaannya terhadap penjajah.Nasution berperan penting dalam perjuangan kemerdekaan Indonesia, terlibat langsung dalam berbagai pertempuran besar melawan pasukan kolonial Belanda. Ia dikenal sebagai seorang perwira yang tegas, cerdas, dan memiliki jiwa kepemimpinan yang kuat. Pada masa revolusi kemerdekaan, Nasution menjabat sebagai Kepala Staf Tentara Keamanan Rakyat (TKR) dan kemudian menjadi Kepala Staf Angkatan Darat (KSAD) setelah Angkatan Darat dibentuk.Salah satu peristiwa penting yang melibatkan Nasution adalah peristiwa 1 Oktober 1965, yang dikenal sebagai Gerakan 30 September atau G30S. Dalam peristiwa tersebut, Nasution selamat meskipun rumahnya diserang dan ia terluka. Kejadian tersebut memicu perubahan besar dalam politik Indonesia, yang berujung pada peralihan kekuasaan.Nasution dikenal dengan kebijakannya yang berani dan tegas dalam menghadapi ancaman terhadap negara. Ia juga berperan penting dalam menyusun konsep strategi militer yang lebih modern bagi Indonesia dan memainkan peran utama dalam berbagai keputusan penting terkait pertahanan negara.Selain karier militernya, Nasution juga aktif dalam dunia politik Indonesia. Ia pernah menjabat sebagai Menteri Pertahanan dan Keamanan pada masa pemerintahan Soeharto. Meskipun dihadapkan dengan berbagai tantangan, Nasution selalu menunjukkan dedikasi dan pengabdiannya kepada negara.Pada akhirnya, Jenderal A.H. Nasution dianugerahi gelar ', 3),
(2, 'Jenderal TNI Suprapto', , 'Jenderal TNI Suprapto, lahir pada 25 Juli 1928 di Magelang, Jawa Tengah, adalah salah satu tokoh militer penting dalam sejarah Indonesia. Lahir dari keluarga sederhana, Suprapto memiliki semangat tinggi untuk mengejar pendidikan. Setelah menamatkan pendidikan dasarnya, ia melanjutkan ke *Militaire Academie* (Akademi Militer) di Magelang, tempat pelatihan bagi calon perwira Belanda, dan lulus pada tahun 1948. Setelah itu, ia bergabung dengan Tentara Keamanan Rakyat (TKR), yang kemudian menjadi Tentara Nasional Indonesia (TNI) pasca kemerdekaan Indonesia.\r\n\r\nSejak awal karier militernya, Suprapto sudah menunjukkan keunggulannya dalam strategi perang dan kepemimpinan. Ia berperan aktif dalam berbagai pertempuran besar melawan pasukan penjajah Belanda selama perjuangan kemerdekaan Indonesia. Keberaniannya di medan perang membuatnya dikenal sebagai salah satu perwira yang memiliki dedikasi tinggi dalam membela tanah air.\r\n\r\nSetelah Indonesia merdeka, Suprapto melanjutkan kariernya dalam Angkatan Darat dengan menempati berbagai posisi penting. Ia dikenal sebagai sosok yang cakap dalam strategi militer dan manajemen pasukan. Selama bertahun-tahun, Suprapto memegang jabatan strategis, termasuk sebagai Komandan Korem di beberapa wilayah yang berkontribusi dalam memperkuat kehadiran negara di daerah-daerah yang rawan konflik. Kepemimpinan dan keterampilannya dalam mengatur pasukan juga sangat membantu dalam pengembangan struktur organisasi TNI yang lebih efektif.\r\n\r\nPada tahun 1960-an, Suprapto menjadi salah satu tokoh militer yang ikut andil dalam reformasi dan pengembangan TNI, menjadikannya bagian dari kekuatan utama yang siap menghadapi berbagai ancaman baik dari dalam maupun luar negeri. Selain kepemimpinan militernya, Suprapto juga berperan dalam politik Indonesia, memberikan saran dan kebijakan terkait pertahanan dan keamanan negara.\r\n\r\nSuprapto tetap dihormati oleh banyak pihak atas dedikasi dan pengabdiannya terhadap negara, bahkan setelah pensiun dari dunia militer. Ia meninggal dunia pada 16 Agustus 2001, namun namanya tetap dikenang sebagai salah satu pahlawan yang memperkuat Angkatan Darat dan membantu membangun fondasi pertahanan Indonesia. Sebagai penghargaan atas jasa-jasanya, ia dianugerahi berbagai tanda kehormatan dan dikenang sebagai sosok yang memiliki semangat perjuangan tanpa henti, serta kepemimpinan yang menginspirasi banyak generasi penerus bangsa.', 3);
INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(3, 'Letnan Jenderal TNI S. Parman', , 'Letnan Jenderal TNI S. Parman adalah salah satu tokoh militer yang sangat berpengaruh dalam sejarah perjuangan Indonesia. Lahir pada 28 Februari 1927 di Banjarnegara, Jawa Tengah, S. Parman tumbuh dalam keluarga yang sederhana namun sangat menghargai pendidikan. Sejak muda, ia sudah menunjukkan minat yang besar dalam dunia militer, yang akhirnya membawanya menempuh pendidikan di Akademi Militer Magelang, tempat pelatihan perwira Belanda yang saat itu menjadi salah satu jalur utama bagi calon perwira Indonesia.\r\n\r\nSetelah lulus dari Akademi Militer pada tahun 1946, S. Parman segera bergabung dengan Tentara Nasional Indonesia (TNI), yang saat itu sedang berjuang keras untuk mempertahankan kemerdekaan dari ancaman Belanda. Ia menjadi salah satu perwira muda yang terlibat langsung dalam perjuangan kemerdekaan Indonesia, bertempur dalam berbagai peristiwa penting, termasuk di medan pertempuran melawan pasukan kolonial Belanda.\r\n\r\nSelama masa Revolusi Kemerdekaan, S. Parman memperlihatkan kepemimpinan yang luar biasa, yang memungkinkannya naik ke posisi-posisi penting dalam struktur militer TNI. Ia dikenal sebagai perwira yang memiliki kemampuan taktis dan strategis yang baik, serta selalu mengedepankan semangat juang yang tinggi. Keberaniannya dalam memimpin pasukan membuatnya dihormati oleh rekan-rekannya dan menjadi inspirasi bagi banyak tentara lainnya.\r\n\r\nPada awal 1960-an, S. Parman menduduki beberapa posisi strategis dalam TNI. Salah satunya adalah sebagai Komandan Kodam VI/Siliwangi, yang membuatnya semakin dikenal dalam dunia militer Indonesia. Dalam posisi tersebut, ia berperan dalam menjaga stabilitas di wilayah Jawa Barat, sekaligus berperan aktif dalam perkembangan dan modernisasi TNI. Ia berfokus pada penguatan organisasi militer, dengan memperkenalkan berbagai pembaruan yang membuat TNI lebih profesional dan siap menghadapi berbagai ancaman.\r\n\r\nNamun, perjalanan kariernya tidak selalu berjalan mulus. Pada 30 September 1965, Indonesia dilanda peristiwa yang dikenal dengan sebutan Gerakan 30 September (G30S). Dalam peristiwa ini, S. Parman menjadi salah satu korban dari upaya pemberontakan yang dilakukan oleh kelompok tertentu. Ia dibunuh oleh anggota G30S bersama dengan sejumlah tokoh penting lainnya dalam upaya kudeta yang mengguncang Indonesia. Kematian S. Parman meninggalkan duka mendalam bagi keluarga, rekan-rekan sejawat, dan seluruh bangsa Indonesia.\r\n\r\nMeskipun gugur pada usia yang relatif muda, Letnan Jenderal TNI S. Parman tetap dikenang sebagai salah satu pahlawan nasional yang berjasa besar dalam perjuangan kemerdekaan dan penguatan pertahanan negara. Jasanya yang luar biasa dalam memperjuangkan kemerdekaan dan membangun kekuatan militer Indonesia tetap dikenang sepanjang sejarah. Untuk menghormati pengabdiannya, ia dianugerahi gelar Jenderal Anumerta dan berbagai penghargaan lainnya atas jasa-jasanya dalam mempertahankan negara. Nama S. Parman tetap hidup dalam ingatan bangsa Indonesia sebagai simbol pengabdian tanpa pamrih dan keberanian yang luar biasa.', 3);
INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(4, 'Letnan Jenderal TNI Ahmad Yani', , 'Letnan Jenderal TNI Ahmad Yani adalah salah satu tokoh militer paling berpengaruh dalam sejarah Indonesia. Lahir pada 19 Juni 1922 di Purworejo, Jawa Tengah, Yani berasal dari keluarga sederhana. Sejak muda, ia sudah menunjukkan minat besar terhadap dunia militer. Ia menempuh pendidikan di sekolah militer Belanda dan lulus pada 1940, saat masih berada di bawah penjajahan Belanda. Namun, setelah Indonesia merdeka, Yani bergabung dengan Tentara Nasional Indonesia (TNI), yang saat itu tengah berjuang keras untuk mempertahankan kemerdekaan dari ancaman Belanda.\r\n\r\nPada masa Revolusi Kemerdekaan, Ahmad Yani terlibat dalam berbagai pertempuran penting, menunjukkan kemampuan militernya yang luar biasa. Ia bertugas dalam berbagai unit tempur dan dengan cepat mendapat pengakuan atas kepemimpinan dan keahliannya. Perjalanan kariernya terus menanjak, dan ia menduduki berbagai posisi strategis di TNI. Keberanian, kecerdasan, dan kedisiplinannya di medan perang menjadikannya sebagai salah satu perwira muda terbaik dalam tubuh TNI.\r\n\r\nPada tahun 1950-an, Yani memimpin berbagai operasi militer di beberapa wilayah konflik. Salah satu posisi penting yang dipegangnya adalah sebagai Komandan Brigade. Dalam jabatannya, ia berhasil membawa satuan yang dipimpinnya meraih kemenangan dalam berbagai pertempuran, memperlihatkan taktik dan strategi militer yang mumpuni.\r\n\r\nAhmad Yani semakin dikenal setelah diangkat menjadi Kepala Staf Angkatan Darat (KSAD) pada tahun 1962. Sebagai KSAD, ia berperan penting dalam penguatan struktur dan modernisasi TNI Angkatan Darat, serta memperkenalkan berbagai reformasi yang menjadikan pasukan lebih profesional. Yani berfokus pada pembenahan organisasi dan strategi militer, serta peningkatan kualitas para prajurit TNI untuk menghadapi ancaman yang ada.\r\n\r\nNamun, perjalanan karier Ahmad Yani berakhir tragis. Pada 30 September 1965, saat terjadi Gerakan 30 September (G30S), ia menjadi salah satu korban dari upaya kudeta yang dilakukan oleh kelompok tertentu. Ahmad Yani, yang saat itu menjabat sebagai Kepala Staf Angkatan Darat, dibunuh oleh anggota G30S dalam peristiwa yang mengguncang Indonesia. Kematian Yani bersama dengan sejumlah tokoh militer lainnya menandai babak baru dalam sejarah Indonesia.\r\n\r\nMeski gugur dalam peristiwa yang tragis, jasa-jasanya tetap dikenang sebagai salah satu pahlawan nasional Indonesia. Ahmad Yani dianggap sebagai simbol pengabdian dan perjuangan tanpa pamrih untuk tanah air. Sebagai penghormatan atas dedikasinya, ia dianugerahi gelar Jenderal Anumerta, dan namanya diabadikan dalam berbagai tempat, termasuk sebuah jalan dan monumen. Letnan Jenderal TNI Ahmad Yani dikenang sepanjang masa sebagai pahlawan yang memperjuangkan kemerdekaan dan kehormatan bangsa Indonesia.', 3);
INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(5, 'Mayor Jenderal TNI M.T. Haryon', , 'Mayor Jenderal TNI M.T. Haryono adalah salah satu tokoh militer Indonesia yang dikenal atas pengabdiannya dalam mempertahankan kemerdekaan dan memperkuat Angkatan Darat Republik Indonesia. Lahir pada 15 Agustus 1928 di Purworejo, Jawa Tengah, M.T. Haryono tumbuh dalam keluarga yang sederhana, namun memiliki semangat juang yang besar. Sejak muda, ia menunjukkan minat yang kuat untuk berkarier di dunia militer, yang kemudian membawanya untuk memasuki Akademi Militer dan bergabung dengan Tentara Nasional Indonesia (TNI).\r\n\r\nSetelah menyelesaikan pendidikan di Akademi Militer, M.T. Haryono segera bergabung dengan TNI pada masa awal kemerdekaan. Ia terlibat langsung dalam berbagai pertempuran besar pada masa revolusi kemerdekaan Indonesia, di mana ia menunjukkan kemampuan taktis dan keberanian yang luar biasa. Pengalamannya dalam medan perang membuatnya dikenal sebagai seorang perwira yang tidak hanya memiliki kecakapan dalam pertempuran, tetapi juga dalam kepemimpinan.\r\n\r\nKarier M.T. Haryono terus berkembang seiring dengan waktu. Ia menduduki berbagai posisi penting dalam struktur Angkatan Darat, termasuk sebagai Komandan Korem, yang memberinya tanggung jawab untuk menjaga stabilitas dan keamanan di daerah-daerah yang rawan konflik. Dalam tugasnya, ia berhasil memperlihatkan dedikasi yang tinggi dalam menjaga keutuhan wilayah negara dan melaksanakan operasi-operasi militer yang penting.\r\n\r\nPada 1960-an, M.T. Haryono diangkat menjadi Komandan Divisi Infanteri dan memainkan peran kunci dalam memperkuat kekuatan militer Indonesia. Ia dikenal sebagai seorang pemimpin yang tegas dan selalu mengutamakan kepentingan bangsa dan negara. Sebagai pemimpin yang cakap dalam strategi militer, ia terlibat dalam berbagai perencanaan operasi yang memiliki dampak besar terhadap stabilitas negara.\r\n\r\nNamun, kehidupan M.T. Haryono berakhir tragis pada 30 September 1965, ketika terjadi peristiwa Gerakan 30 September (G30S). Saat itu, M.T. Haryono, yang menjabat sebagai salah satu komandan tinggi di Angkatan Darat, menjadi korban dari upaya kudeta tersebut. Ia dibunuh bersama dengan beberapa tokoh penting lainnya dalam peristiwa yang mengguncang Indonesia. Kematian M.T. Haryono meninggalkan duka yang mendalam bagi bangsa Indonesia, dan ia dikenang sebagai salah satu pahlawan yang memperjuangkan kemerdekaan dan membela negara.\r\n\r\nSebagai penghormatan atas jasa-jasanya, M.T. Haryono dianugerahi gelar Jenderal Anumerta dan berbagai penghargaan lainnya. Namanya tetap dikenang oleh masyarakat Indonesia sebagai simbol pengabdian dan keberanian dalam menghadapi tantangan untuk mempertahankan keutuhan dan kemerdekaan bangsa.', 3);
INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(6, 'Brigadir Jenderal Soetojo', , 'Brigadir Jenderal Soetojo adalah salah satu tokoh militer Indonesia yang memiliki peran penting dalam sejarah perjuangan kemerdekaan dan pengembangan Angkatan Darat Indonesia. Ia lahir pada 7 Februari 1924, di Magelang, Jawa Tengah. Sejak muda, Soetojo memiliki semangat untuk mengabdi kepada negara, yang mendorongnya untuk memasuki dunia militer. Ia mengikuti pendidikan militer di Akademi Militer dan lulus sebagai perwira muda.\r\n\r\nPada masa Revolusi Kemerdekaan Indonesia, Soetojo terlibat dalam perjuangan melawan pasukan Belanda. Ia bergabung dengan Tentara Keamanan Rakyat (TKR), yang kemudian menjadi Tentara Nasional Indonesia (TNI), dan turut serta dalam berbagai pertempuran penting. Keberaniannya dalam pertempuran dan kemampuan kepemimpinannya di medan perang membuatnya dikenal sebagai salah satu perwira yang sangat dihormati di kalangan prajurit.\r\n\r\nSetelah masa perjuangan kemerdekaan, Soetojo terus berkembang dalam karier militernya. Ia mengisi berbagai jabatan penting di tubuh Angkatan Darat, salah satunya sebagai Komandan Korem. Dalam jabatannya, ia bertanggung jawab atas pengawasan dan pengamanan wilayah yang memiliki peran strategis dalam menjaga stabilitas dan keutuhan negara.\r\n\r\nSebagai pemimpin, Soetojo dikenal sangat tegas dan berdisiplin tinggi. Ia sangat memperhatikan peningkatan kualitas prajurit dan pengembangan strategi militer yang lebih modern, serta selalu mengutamakan kepentingan negara dalam setiap langkah yang diambilnya. Kepemimpinannya juga dilengkapi dengan kemampuannya dalam memimpin pasukan dalam operasi militer yang besar dan menentukan.\r\n\r\nNamun, perjalanan hidup Brigadir Jenderal Soetojo berakhir pada 30 September 1965. Dalam peristiwa Gerakan 30 September (G30S), ia menjadi salah satu korban dari upaya kudeta yang dilakukan oleh kelompok tertentu. Ia dibunuh bersama sejumlah tokoh militer lainnya dalam peristiwa yang mengguncang Indonesia. Kematian Soetojo, seperti halnya banyak perwira lainnya, menjadi sebuah kehilangan besar bagi Angkatan Darat Indonesia dan bangsa Indonesia secara keseluruhan.\r\n\r\nSebagai bentuk penghormatan atas pengorbanannya, Soetojo dianugerahi gelar Jenderal Anumerta. Namanya tetap dikenang sebagai salah satu pahlawan nasional yang setia mengabdi kepada bangsa dan negara. Pengabdian dan keberaniannya dalam menghadapi tantangan untuk menjaga kemerdekaan dan keutuhan negara menjadikan Soetojo sebagai simbol pengorbanan dan dedikasi dalam perjuangan Indonesia.', 3);
INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(7, 'Brigadir Jenderal D.I. Pandjai', , 'Brigadir Jenderal D.I. Pandjaitan adalah salah satu tokoh militer penting dalam sejarah Indonesia, terutama dikenal karena pengabdiannya yang luar biasa dalam mempertahankan kemerdekaan dan mengembangkan kekuatan militer negara. Lahir dengan nama lengkap Donald Isaac Pandjaitan pada 28 Januari 1925 di Sidikalang, Sumatera Utara, ia berasal dari keluarga yang menjunjung tinggi nilai-nilai perjuangan dan kemerdekaan. Sejak muda, D.I. Pandjaitan sudah menunjukkan minat besar terhadap dunia militer dan bertekad untuk mengabdikan diri bagi negara.\r\n\r\nPada masa awal kemerdekaan Indonesia, D.I. Pandjaitan bergabung dengan Tentara Keamanan Rakyat (TKR), yang kemudian menjadi Tentara Nasional Indonesia (TNI). Ia terlibat langsung dalam perjuangan melawan pasukan Belanda yang ingin menguasai kembali Indonesia. Dalam berbagai pertempuran, D.I. Pandjaitan dikenal sebagai perwira yang memiliki keberanian tinggi dan kecakapan dalam memimpin pasukannya. Peranannya dalam Revolusi Kemerdekaan sangat signifikan, dan ia turut memperjuangkan kemerdekaan Indonesia.\r\n\r\nSetelah masa revolusi, D.I. Pandjaitan terus mengembangkan karier militernya. Ia mengisi beberapa posisi penting di tubuh TNI, antara lain sebagai Komandan Korem, serta memimpin berbagai operasi militer strategis. D.I. Pandjaitan juga dikenal memiliki kemampuan dalam perencanaan dan pelaksanaan strategi militer yang cermat dan efektif.\r\n\r\nSalah satu puncak karier D.I. Pandjaitan adalah ketika ia dipercaya untuk menjabat sebagai Wakil Kepala Staf Angkatan Darat. Dalam posisi ini, ia berperan dalam pengembangan TNI dan memperkuat struktur organisasi Angkatan Darat. Kepemimpinannya yang tegas dan penuh dedikasi menjadikan D.I. Pandjaitan sebagai sosok yang dihormati oleh rekan-rekan sejawatnya, baik di kalangan prajurit maupun para pemimpin militer.\r\n\r\nNamun, perjalanan hidup D.I. Pandjaitan berakhir tragis pada 30 September 1965, saat terjadinya peristiwa Gerakan 30 September (G30S). Dalam upaya kudeta tersebut, D.I. Pandjaitan menjadi salah satu korban yang dibunuh oleh kelompok yang ingin merebut kekuasaan. Kepergiannya, bersama sejumlah tokoh militer lainnya, mengguncang Indonesia, dan kematiannya dianggap sebagai salah satu momen kelam dalam sejarah militer Indonesia.\r\n\r\nSebagai bentuk penghormatan atas jasa-jasanya, D.I. Pandjaitan dianugerahi gelar Jenderal Anumerta. Namanya diabadikan dalam berbagai tempat dan monumen sebagai simbol pengabdian dan keberaniannya. D.I. Pandjaitan dikenang sebagai pahlawan yang memberikan seluruh hidupnya untuk membela tanah air dan perjuangan kemerdekaan Indonesia, serta menjadi simbol dedikasi tanpa pamrih kepada negara.', 3);
INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(8, 'Letnan P.A. Tendean', , 'Letnan P.A. Tendean adalah salah satu pahlawan Indonesia yang menjadi korban dalam peristiwa tragis Gerakan 30 September (G30S) pada tahun 1965. Lahir pada 21 Februari 1939 di Tondano, Sulawesi Utara, P.A. Tendean adalah seorang perwira muda yang memiliki dedikasi tinggi terhadap pengabdiannya di Angkatan Darat.\r\n\r\nP.A. Tendean masuk ke dunia militer dengan penuh semangat, dan setelah menuntaskan pendidikan di Akademi Militer, ia mulai berkarier di Tentara Nasional Indonesia (TNI). Meskipun usianya masih muda, ia sudah terlibat dalam berbagai tugas militer penting. Sebagai seorang perwira, ia dikenal sebagai sosok yang disiplin, bertanggung jawab, dan memiliki jiwa kepemimpinan yang kuat. Pada masa itu, P.A. Tendean menjabat sebagai ajudan pribadi Letnan Jenderal Ahmad Yani, Kepala Staf Angkatan Darat yang saat itu juga menjadi salah satu tokoh penting dalam tubuh militer Indonesia.\r\n\r\nPada 30 September 1965, ketika terjadi upaya kudeta yang dikenal dengan peristiwa G30S, P.A. Tendean berada di kediaman Letnan Jenderal Ahmad Yani. Saat itu, ia menjadi salah satu dari sekian banyak perwira yang dibunuh oleh anggota G30S. P.A. Tendean, yang sedang menjalankan tugasnya sebagai ajudan, menjadi salah satu korban dalam pembantaian yang mengguncang Indonesia dan meninggalkan luka mendalam dalam sejarah negara.\r\n\r\nMeski usianya masih muda, P.A. Tendean meninggalkan warisan sebagai salah satu pahlawan nasional yang dengan setia mengabdikan diri untuk negara. Sebagai bentuk penghormatan atas jasanya, P.A. Tendean dianugerahi gelar Jenderal Anumerta. Nama dan perjuangannya tetap dikenang sebagai simbol keberanian, pengorbanan, dan kesetiaan kepada negara, serta menjadi bagian dari daftar pahlawan yang memperjuangkan kemerdekaan dan menjaga keutuhan Indonesia.', 3);
INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(9, 'Soekarno', , 'Soekarno, yang lahir pada 6 Juni 1901 di Surabaya, adalah Presiden pertama Republik Indonesia dan salah satu tokoh paling penting dalam sejarah perjuangan kemerdekaan Indonesia. Ia dikenal sebagai Bapak Proklamator Indonesia karena perannya yang sangat besar dalam memproklamirkan kemerdekaan Indonesia pada 17 Agustus 1945. Soekarno adalah sosok yang visioner dan penuh semangat juang, yang memiliki tekad kuat untuk mewujudkan kemerdekaan Indonesia dari penjajahan Belanda.\r\n\r\nSoekarno berasal dari keluarga yang cukup terpelajar. Ayahnya, Raden Soekemi Sosrodihardjo, adalah seorang guru, sementara ibunya, Ida Ayu Nyoman Rai, berasal dari Bali. Soekarno menempuh pendidikan di berbagai sekolah, dan sejak muda ia sudah menunjukkan minat besar dalam dunia politik dan pergerakan kemerdekaan. Ia belajar di berbagai sekolah di Indonesia dan kemudian melanjutkan pendidikannya di Technische Hoogeschool (sekarang ITB) di Bandung, jurusan teknik sipil, sebelum akhirnya lebih fokus pada kegiatan politik.\r\n\r\nPada tahun 1927, Soekarno mendirikan Partai Nasional Indonesia (PNI), yang tujuannya adalah untuk mencapai kemerdekaan Indonesia melalui jalur perlawanan terhadap penjajahan Belanda. Ia dikenal dengan pidato-pidatonya yang berapi-api dan ide-idenya yang radikal untuk memperjuangkan kemerdekaan Indonesia. Soekarno kemudian beberapa kali dipenjara oleh pemerintahan kolonial Belanda karena aktivitas politiknya. Namun, perjuangannya tidak pernah surut, dan ia tetap menjadi simbol perlawanan terhadap penjajahan.\r\n\r\nPada 17 Agustus 1945, setelah Jepang menyerah kepada Sekutu, Soekarno bersama Mohammad Hatta memproklamirkan kemerdekaan Indonesia. Proklamasi ini mengakhiri hampir 350 tahun penjajahan asing di Indonesia dan menandai lahirnya Republik Indonesia. Soekarno kemudian menjadi Presiden pertama Indonesia dan memimpin negara yang baru merdeka itu melalui masa-masa yang sangat krusial.\r\n\r\nSebagai Presiden, Soekarno berperan dalam membangun fondasi negara Indonesia, memimpin proses perumusan konstitusi, dan memperjuangkan pengakuan internasional atas kemerdekaan Indonesia. Ia juga mendirikan konsep-konsep penting seperti Pancasila, yang menjadi dasar negara Indonesia, serta mendorong gerakan Non-Blok untuk menyeimbangkan kekuatan antara negara-negara besar di dunia pada masa Perang Dingin.\r\n\r\nSoekarno memimpin Indonesia selama hampir tiga dekade, namun masa pemerintahannya juga diwarnai oleh berbagai tantangan. Ia mengalami ketegangan politik dengan kelompok-kelompok yang berbeda, terutama antara pihak militer dan komunis. Ketegangan ini mencapai puncaknya pada peristiwa 30 September 1965 (G30S), yang mengarah pada pengunduran dirinya pada tahun 1967. Soekarno digantikan oleh Soeharto yang kemudian memimpin Indonesia dengan sistem Orde Baru.\r\n\r\nMeskipun tidak lagi menjabat sebagai Presiden, Soekarno tetap dihormati sebagai Bapak Bangsa dan penggerak utama kemerdekaan Indonesia. Ia meninggal pada 21 Juni 1970, di usia 69 tahun. Soekarno dikenang sebagai seorang visioner, orator ulung, dan pemimpin yang sangat berperan dalam perjuangan kemerdekaan Indonesia. Namanya diabadikan dalam berbagai tempat dan monumen, dan ia tetap menjadi simbol semangat juang dan kebanggaan nasional Indonesia.', 1);
INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(10, 'Mohammad Hatta', , 'Mohammad Hatta, yang dikenal sebagai Bung Hatta, adalah salah satu tokoh paling penting dalam sejarah Indonesia, terutama dalam perjuangan kemerdekaan dan pembentukan negara Republik Indonesia. Lahir pada 12 Agustus 1902 di Bukittinggi, Sumatera Barat, Hatta datang dari keluarga yang cukup sederhana namun memiliki nilai-nilai pendidikan yang kuat. Ayahnya adalah seorang pedagang, dan Hatta menerima pendidikan awal di tanah kelahirannya sebelum melanjutkan studi ke Belanda.\r\n\r\nHatta menempuh pendidikan di Belanda, di mana ia belajar di sekolah tinggi ekonomi (Hogere Burger School) dan kemudian di Universitas Negeri Rotterdam. Selama di Belanda, Hatta semakin tertarik pada pergerakan kemerdekaan Indonesia dan mulai terlibat dalam organisasi-organisasi yang memperjuangkan kebebasan Indonesia dari penjajahan Belanda. Ia bergabung dengan organisasi pergerakan seperti Perhimpunan Indonesia, yang menjadi wadah bagi para mahasiswa Indonesia di luar negeri untuk memperjuangkan kemerdekaan.\r\n\r\nPada tahun 1930, Hatta kembali ke Indonesia dan semakin aktif dalam kegiatan politik. Ia bergabung dengan Partai Indonesia Raya (Parindra), yang dipimpin oleh Soekarno, dan bersama-sama mereka memperjuangkan kemerdekaan Indonesia melalui jalur diplomasi dan perlawanan terhadap penjajahan. Hatta dikenal sebagai sosok yang cerdas, memiliki pemikiran yang luas, dan mendalami ilmu ekonomi, yang membuatnya mampu memberikan kontribusi besar dalam pembentukan kebijakan ekonomi negara setelah kemerdekaan.\r\n\r\nSaat proklamasi kemerdekaan Indonesia pada 17 Agustus 1945, Mohammad Hatta berperan sebagai wakil dari Soekarno dan ikut serta dalam membacakan teks proklamasi kemerdekaan. Sebagai wakil presiden pertama Indonesia, Hatta bekerja sama dengan Soekarno untuk membangun negara baru ini. Hatta memegang peran penting dalam proses perumusan kebijakan negara, terutama dalam bidang ekonomi, dan ia adalah salah satu tokoh yang mengusulkan dasar negara Indonesia, yaitu Pancasila.\r\n\r\nSetelah Indonesia merdeka, Hatta banyak terlibat dalam urusan politik dan pemerintahan. Ia dikenal sebagai seorang pemimpin yang moderat, lebih mengutamakan kepentingan rakyat dan negara daripada kepentingan pribadi atau golongan. Dalam masa pemerintahannya, Hatta turut memperjuangkan sistem ekonomi yang adil dan berkeadilan sosial, serta berperan penting dalam membentuk kebijakan luar negeri Indonesia yang bersifat non-blok.\r\n\r\nNamun, hubungan politik antara Soekarno dan Hatta mulai mengalami ketegangan pada tahun 1950-an, terutama terkait dengan cara pandang mereka terhadap sistem pemerintahan dan ekonomi negara. Pada tahun 1956, Hatta mengundurkan diri dari jabatan wakil presiden dan memilih untuk fokus pada bidang lain, meskipun ia tetap aktif memberikan masukan dan pemikiran bagi negara.\r\n\r\nBung Hatta tetap menjadi tokoh yang dihormati sepanjang hayatnya dan dikenal sebagai Bapak Koperasi Indonesia, karena ia memandang koperasi sebagai salah satu cara untuk mencapai kesejahteraan rakyat. Ia juga dikenal sebagai sosok yang sederhana, jujur, dan memiliki integritas tinggi.\r\n\r\nMohammad Hatta meninggal pada 14 Maret 1980 di Jakarta. Ia dikenang sebagai salah satu pahlawan nasional yang berperan besar dalam merebut dan mempertahankan kemerdekaan Indonesia, serta dalam mendirikan dasar-dasar negara yang kokoh. Namanya diabadikan dalam berbagai penghargaan, dan ia tetap menjadi simbol intelektualitas, kepemimpinan, dan perjuangan bagi kemerdekaan Indonesia.', 1);
