(11, 'Raden Ajeng Kartini', , 'Raden Ajeng Kartini adalah salah satu tokoh paling terkenal dalam sejarah Indonesia, dikenal sebagai pelopor emansipasi wanita dan perjuangan hak-hak perempuan. Ia lahir pada 21 April 1879 di Jepara, Jawa Tengah, dalam keluarga bangsawan Jawa. Kartini berasal dari keluarga yang cukup terhormat, ayahnya, Raden Sosroningrat, adalah seorang bupati di Jepara, sementara ibunya, Ngasirah, berasal dari keluarga priyayi. Meskipun berasal dari keluarga bangsawan, Kartini sangat peduli terhadap kondisi perempuan di Indonesia yang pada masa itu hidup dalam keterbatasan hak dan kebebasan.\r\n\r\nKartini menerima pendidikan yang baik untuk ukuran wanita pada masanya. Ia belajar di rumah bersama kakak-kakaknya dan beberapa guru privat. Namun, di balik pendidikan yang ia terima, Kartini merasakan adanya ketidakadilan sosial, terutama dalam hal pendidikan dan kebebasan perempuan. Di masa itu, perempuan dipandang rendah dan terkungkung oleh adat istiadat yang membatasi peran dan hak mereka. Salah satu hal yang sangat membebani Kartini adalah tradisi poligami dan sistem kawin paksa yang diterima begitu saja oleh sebagian besar perempuan pada waktu itu.\r\n\r\nSebagai seorang wanita yang cerdas dan penuh rasa ingin tahu, Kartini mulai membaca buku-buku yang membahas tentang perjuangan hak-hak perempuan di dunia, terutama yang datang dari Eropa. Ia banyak dipengaruhi oleh gagasan-gagasan feminisme yang ia temui, dan dengan tekad untuk memajukan perempuan Indonesia, Kartini menulis surat-surat yang menggambarkan pemikirannya tentang emansipasi wanita dan pentingnya pendidikan bagi perempuan. Surat-surat ini kemudian diterbitkan oleh seorang teman Belanda, yaitu J.H. Abendanon, dengan judul \"Habis Gelap Terbitlah Terang\". Buku ini menjadi sangat terkenal dan memperkenalkan Kartini sebagai seorang pemikir progresif di Indonesia.\r\n\r\nSelain perjuangannya untuk hak-hak perempuan, Kartini juga sangat memperhatikan pendidikan anak-anak, terutama anak perempuan. Ia berpendapat bahwa untuk meningkatkan kualitas hidup perempuan, salah satu langkah utama adalah dengan memberikan mereka kesempatan untuk mendapatkan pendidikan yang setara dengan laki-laki. Ia menginginkan perempuan memiliki kebebasan untuk memilih jalan hidup mereka sendiri dan tidak hanya bergantung pada peran tradisional yang dibebankan kepada mereka oleh masyarakat.\r\n\r\nPada usia yang masih muda, 25 tahun, Kartini menikah dengan Bupati Rembang, Raden Adipati Joyodiningrat, meskipun pernikahan itu tidak mengubah pandangannya mengenai emansipasi wanita. Namun, pada 17 September 1904, Kartini meninggal dunia setelah melahirkan anak pertama, dalam usia yang sangat muda. Meskipun hidupnya singkat, pemikiran dan perjuangan Kartini meninggalkan warisan yang sangat besar bagi perempuan Indonesia. \r\n\r\nKartini kini dikenang sebagai pahlawan nasional Indonesia dan simbol perjuangan hak-hak perempuan. Hari lahirnya, 21 April, diperingati sebagai Hari Kartini, sebuah momen untuk menghormati perjuangannya dan mengingatkan bangsa Indonesia tentang pentingnya pemberdayaan perempuan serta kesetaraan gender. Kartini menjadi inspirasi bagi banyak perempuan di Indonesia untuk terus memperjuangkan hak-hak mereka, pendidikan, dan kebebasan dalam memilih masa depan mereka.', 2);
