(12, 'Cut Nyak Dhien', , 'Cut Nyak Dhien adalah salah satu pahlawan wanita Indonesia yang dikenal karena peranannya dalam perlawanan terhadap penjajahan Belanda, khususnya dalam Perang Aceh yang berlangsung dari 1873 hingga 1904. Ia lahir sekitar tahun 1848 di Aceh, Sumatera, dan berasal dari keluarga bangsawan Aceh. Nama lengkapnya adalah Cut Nyak Dhien, dan ia dikenal sebagai seorang pejuang yang sangat berani dan memiliki semangat juang yang tinggi.\r\n\r\nPada awalnya, Cut Nyak Dhien hidup dalam kehidupan yang relatif tenang sebagai seorang wanita dari keluarga bangsawan. Namun, kehidupan dan ketenangannya berubah setelah suaminya, Teuku Umar, seorang pejuang Aceh yang berjuang melawan penjajahan Belanda, meninggal pada 1899. Setelah suaminya gugur, Cut Nyak Dhien melanjutkan perjuangan untuk membela tanah airnya. Ia tidak hanya dikenal sebagai seorang ibu yang penuh kasih sayang, tetapi juga sebagai pemimpin militer yang tangguh.\r\n\r\nCut Nyak Dhien menjadi pemimpin dalam perlawanan rakyat Aceh terhadap Belanda, dan ia memimpin pasukan gerilya yang melakukan perlawanan sengit terhadap penjajah. Dengan kepiawaian taktis, ia memimpin serangan-serangan gerilya yang efektif, yang sering kali mengecoh pasukan Belanda yang lebih besar. Ia juga terkenal dengan keberaniannya dalam menghadapi serangan-serangan brutal Belanda, serta kemampuannya untuk mengatur pasukan secara strategis.\r\n\r\nPada masa perjuangannya, Cut Nyak Dhien mengalami penderitaan yang besar. Beliau kehilangan banyak orang yang dikasihi, termasuk suami tercinta, dan dalam perjuangannya ia harus berhadapan dengan berbagai kesulitan, baik fisik maupun mental. Meskipun demikian, semangat juang Cut Nyak Dhien tidak pernah padam. Ia terus menggerakkan pasukannya, memberi inspirasi kepada rakyat Aceh untuk berjuang melawan Belanda, dan memperlihatkan ketangguhan sebagai seorang pemimpin wanita.\r\n\r\nNamun, pada tahun 1905, setelah bertahun-tahun berperang, Cut Nyak Dhien akhirnya tertangkap oleh pasukan Belanda. Ia ditangkap setelah mengalami berbagai pertempuran sengit di hutan-hutan Aceh. Beliau kemudian dibuang ke Sumatera Selatan, di mana ia meninggal pada 6 November 1908 dalam keadaan sakit. Meski ia tidak pernah melihat kemerdekaan Indonesia, perjuangan dan semangatnya tetap dikenang sebagai simbol keberanian dan ketangguhan seorang pejuang wanita.\r\n\r\nCut Nyak Dhien diakui sebagai pahlawan nasional Indonesia pada tahun 1964, dan namanya dikenang sebagai salah satu pahlawan wanita yang berjuang gigih untuk mempertahankan kemerdekaan Indonesia. Perjuangannya menunjukkan bahwa perempuan Indonesia juga memiliki peran penting dalam perjuangan bangsa, tidak hanya sebagai ibu rumah tangga, tetapi juga sebagai pejuang yang berani menghadapi segala tantangan demi kemerdekaan tanah airnya.', 2),
(13, 'Nyi Ageng Serang', , 'Nyi Ageng Serang, yang memiliki nama lengkap Raden Ayu Siti Khotijah, adalah salah satu pahlawan wanita Indonesia yang terkenal karena peranannya dalam perjuangan melawan penjajahan Belanda di Tanah Jawa pada abad ke-19. Ia lahir pada tahun 1765 di Serang, Banten, dalam keluarga bangsawan. Nyi Ageng Serang dikenal sebagai seorang pejuang tangguh yang tidak hanya memiliki jiwa kepemimpinan yang besar, tetapi juga memiliki kecerdasan dan keberanian luar biasa dalam menghadapi tekanan penjajah.\r\n\r\nNyi Ageng Serang adalah putri dari Bupati Serang, Raden Pahlawan, yang menjabat di daerah Banten. Sejak muda, ia sudah memperlihatkan semangat juang yang tinggi. Ketika ayahnya meninggal, Nyi Ageng Serang menjadi pemimpin bagi wilayah Serang dan sekitarnya. Pada masa itu, Belanda sedang memperluas penjajahannya di Indonesia dan melakukan penindasan terhadap rakyat pribumi, termasuk di Banten.\r\n\r\nPada tahun 1808, Belanda di bawah pimpinan Gubernur Jenderal Herman Willem Daendels mencoba untuk menguasai daerah Banten, dan mereka mulai melakukan penindasan yang lebih keras terhadap masyarakat lokal. Nyi Ageng Serang tidak tinggal diam menghadapi situasi ini. Ia memimpin perlawanan di Banten dengan membentuk pasukan yang kuat dan melancarkan serangan terhadap pasukan Belanda. Ia dikenal sebagai sosok yang sangat berani, bahkan lebih menonjol dibandingkan banyak pemimpin militer pria pada masa itu.\r\n\r\nKeberanian dan ketangguhan Nyi Ageng Serang dalam berperang membuatnya menjadi salah satu pahlawan yang dihormati oleh rakyat Banten. Ia tidak hanya mengandalkan kekuatan fisik dalam pertempuran, tetapi juga menggunakan kecerdikan dan strategi yang matang. Sebagai seorang pemimpin perempuan, Nyi Ageng Serang mampu memotivasi dan menyatukan rakyat untuk melawan penjajah Belanda. Meskipun pasukannya tidak selalu unggul secara jumlah, strategi gerilya dan semangat juangnya yang tinggi membuat perlawanan terhadap Belanda cukup efektif.\r\n\r\nNamun, meskipun semangat juang Nyi Ageng Serang sangat besar, ia akhirnya ditangkap oleh Belanda pada tahun 1813. Setelah penangkapannya, ia diasingkan ke Batavia (sekarang Jakarta) dan dipenjarakan hingga akhir hayatnya. Nyi Ageng Serang meninggal pada tahun 1850. Meskipun perjuangannya tidak langsung berakhir dengan kemenangan, semangat perlawanan yang ia tunjukkan tetap menjadi inspirasi bagi generasi-generasi berikutnya.\r\n\r\nNyi Ageng Serang dikenang sebagai salah satu pahlawan nasional Indonesia, khususnya sebagai simbol keberanian perempuan dalam perjuangan kemerdekaan. Namanya sering diperingati untuk mengingatkan kita akan peran penting perempuan dalam sejarah perjuangan Indonesia. Perjuangannya menunjukkan bahwa semangat kemerdekaan dan perlawanan terhadap penjajah tidak mengenal batas gender, dan perempuan pun dapat menjadi pemimpin yang tangguh dalam membela tanah air.', 2);
