(14, 'Cut Nyak Meutia', , 'Cut Nyak Meutia adalah salah satu pahlawan wanita Indonesia yang dikenal karena perjuangannya dalam Perang Aceh melawan penjajahan Belanda. Lahir pada tahun 1870 di Aceh, ia berasal dari keluarga bangsawan Aceh. Nama lengkapnya adalah Cut Nyak Meutia binti Muhammad Saman. Sejak muda, Cut Nyak Meutia sudah menunjukkan semangat nasionalisme yang tinggi dan keinginan untuk berjuang demi tanah airnya.\r\n\r\nPada masa itu, Aceh sedang terlibat dalam perjuangan sengit melawan penjajahan Belanda yang dimulai sejak 1873. Belanda berusaha menguasai Aceh yang kaya akan sumber daya alam, sementara rakyat Aceh, termasuk perempuan seperti Cut Nyak Meutia, berjuang mempertahankan kemerdekaan mereka. Setelah suaminya, Teuku Umar, yang merupakan salah satu tokoh penting dalam perlawanan terhadap Belanda, gugur pada 1899, Cut Nyak Meutia melanjutkan perjuangannya.\r\n\r\nSebagai seorang pemimpin wanita, Cut Nyak Meutia tidak hanya terlibat dalam pertempuran fisik tetapi juga dalam mengorganisasi pasukan dan memberi semangat kepada pejuang Aceh. Ia terkenal karena keberaniannya di medan perang dan kemampuan dalam memimpin pasukan gerilya. Dalam perjuangannya, ia memimpin serangan-serangan terhadap pasukan Belanda yang lebih kuat, namun tetap menjaga semangat perlawanan yang tinggi di kalangan rakyat Aceh.\r\n\r\nBelanda yang menyadari kekuatan perlawanan Aceh, termasuk dari para wanita seperti Cut Nyak Meutia, akhirnya semakin memperketat penjagaan dan menyerang dengan lebih brutal. Meskipun begitu, Cut Nyak Meutia tidak gentar. Ia terus berjuang hingga akhirnya, pada tahun 1910, Cut Nyak Meutia tertangkap oleh pasukan Belanda. Setelah penangkapannya, ia diasingkan ke Sumatera Selatan, dan kemudian pada 1911, ia meninggal dunia dalam kondisi yang penuh penderitaan akibat penyakit yang dideritanya.\r\n\r\nCut Nyak Meutia dikenang sebagai salah satu pahlawan nasional Indonesia yang berani dan gigih memperjuangkan kemerdekaan. Meskipun ia tidak sempat melihat Indonesia merdeka, semangat juang dan keteguhannya tetap dikenang sebagai simbol kekuatan perempuan dalam perjuangan bangsa. Namanya diabadikan dalam berbagai penghargaan, dan ia menjadi inspirasi bagi banyak orang, terutama perempuan, untuk terus berjuang demi kemerdekaan dan keadilan.', 2);
