(15, 'Dewi Sartika', , 'Dewi Sartika adalah seorang pahlawan wanita Indonesia yang dikenal sebagai pelopor pendidikan bagi perempuan di Indonesia, khususnya di Jawa Barat. Ia lahir pada 4 Desember 1884 di Cicalengka, Jawa Barat, dalam keluarga bangsawan. Nama aslinya adalah Raden Dewi Sartika, dan ia berasal dari keluarga yang memiliki latar belakang pendidikan yang cukup baik. Ayahnya, Raden Wiryana, adalah seorang pejabat yang memiliki pemikiran terbuka mengenai pendidikan.\r\n\r\nSejak muda, Dewi Sartika sudah menunjukkan minat yang besar terhadap dunia pendidikan. Pada masa itu, pendidikan bagi perempuan di Indonesia sangat terbatas. Banyak perempuan yang tidak diberi kesempatan untuk mengenyam pendidikan yang layak, bahkan sebagian besar dari mereka hanya menjalani peran tradisional sebagai ibu rumah tangga. Namun, Dewi Sartika bertekad untuk mengubah keadaan ini.\r\n\r\nPada tahun 1904, Dewi Sartika mendirikan sekolah untuk perempuan pertama di Bandung, yang dikenal dengan nama Sekolah Istri, yang kemudian berubah menjadi Sekolah Dewi Sartika. Melalui sekolah ini, ia ingin memberikan akses pendidikan bagi perempuan, agar mereka dapat memiliki pengetahuan yang berguna bagi kehidupan mereka dan bisa berperan dalam masyarakat.\r\n\r\nSekolah yang didirikan oleh Dewi Sartika ini tidak hanya mengajarkan keterampilan dasar seperti membaca, menulis, dan berhitung, tetapi juga keterampilan praktis yang dapat membantu perempuan untuk mandiri, seperti keterampilan menjahit dan memasak. Dewi Sartika percaya bahwa pendidikan adalah kunci untuk memperbaiki kehidupan perempuan dan membuka kesempatan bagi mereka untuk berperan lebih aktif di masyarakat.\r\n\r\nPada masa itu, banyak orang tua yang tidak memahami pentingnya pendidikan bagi anak perempuan, sehingga Dewi Sartika harus bekerja keras untuk meyakinkan mereka bahwa perempuan juga berhak mendapatkan pendidikan yang layak. Meskipun menghadapi banyak tantangan, Dewi Sartika tidak pernah menyerah. Ia terus mengembangkan sekolahnya dan memperjuangkan hak-hak perempuan untuk mendapatkan pendidikan.\r\n\r\nSelain mengembangkan sekolah, Dewi Sartika juga aktif dalam berbagai organisasi sosial dan pendidikan yang bertujuan untuk memberdayakan perempuan. Ia berperan dalam meningkatkan kesadaran tentang pentingnya pendidikan bagi perempuan di seluruh Indonesia, bukan hanya di Jawa Barat.\r\n\r\nDewi Sartika dikenal sebagai sosok yang penuh dedikasi dan memiliki semangat juang yang tinggi. Ia memperjuangkan hak perempuan untuk mendapatkan pendidikan, yang pada masa itu dianggap sebagai sesuatu yang tidak lazim. Bagi Dewi Sartika, pendidikan adalah alat untuk mencapai kemajuan dan perubahan, baik bagi perempuan maupun bangsa Indonesia secara keseluruhan.\r\n\r\nDewi Sartika meninggal pada 11 September 1947, namun jasanya dalam dunia pendidikan tetap dikenang hingga saat ini. Ia diangkat sebagai pahlawan nasional Indonesia pada tahun 1966, dan perjuangannya dalam memajukan pendidikan perempuan tetap menjadi inspirasi bagi banyak orang. Hari lahirnya, 4 Desember, juga diperingati sebagai hari pendidikan nasional di Indonesia sebagai penghormatan atas perjuangannya dalam memajukan pendidikan, khususnya untuk perempuan.', 2),
(16, 'Hj. Fatmawati Soekarno', , 'Hj. Fatmawati Soekarno adalah seorang tokoh penting dalam sejarah Indonesia, terkenal sebagai istri pertama Presiden pertama Republik Indonesia, Ir. Soekarno. Ia lahir pada 5 Februari 1923 di Bengkulu, dalam keluarga yang berasal dari latar belakang masyarakat setempat. Sejak muda, Fatmawati dikenal sebagai seorang perempuan yang cerdas, tangguh, dan penuh semangat. Pendidikan yang diterimanya cukup memadai, membuatnya mampu menghadapi berbagai tantangan di masa depan. \r\n\r\nFatmawati menikah dengan Ir. Soekarno pada tahun 1943, ketika Soekarno masih aktif memperjuangkan kemerdekaan Indonesia dari penjajahan Belanda. Mereka berdua menjalin hubungan yang erat, didasari oleh semangat perjuangan yang sama untuk membebaskan tanah air. Hubungan mereka tidak hanya sebatas pernikahan biasa, tetapi juga sebagai kerjasama dalam memajukan semangat kemerdekaan. Fatmawati mendukung suaminya dalam banyak aspek, baik secara moral maupun praktis. \r\n\r\nSalah satu peran paling bersejarah yang dijalankan Fatmawati adalah ketika ia ikut berperan dalam pembuatan bendera merah putih. Ia dipercaya untuk menjahit bendera tersebut, yang kemudian dikibarkan pada 17 Agustus 1945 di Jakarta sebagai simbol proklamasi kemerdekaan Indonesia. Tindakan ini menjadikan Fatmawati sebagai bagian integral dalam momen bersejarah bangsa Indonesia, menjadikannya pahlawan tak terlihat yang turut mengukir sejarah.\r\n\r\nSetelah proklamasi, Fatmawati menjadi Ibu Negara pertama Republik Indonesia. Ia tidak hanya menjalankan peran sebagai istri presiden, tetapi juga aktif dalam berbagai kegiatan sosial dan organisasi yang bertujuan untuk memberdayakan perempuan dan membantu masyarakat. Fatmawati dikenal sebagai sosok yang gigih dalam memperjuangkan hak-hak perempuan, serta berkontribusi dalam pembentukan berbagai inisiatif sosial di negara yang baru merdeka ini. \r\n\r\nFatmawati dan Soekarno dikaruniai dua anak, yaitu Megawati Soekarnoputri dan Guntur Soekarnoputra. Megawati kelak tumbuh menjadi tokoh politik yang terkenal dan menjadi Presiden Indonesia kelima, sementara Guntur menjalani peran yang lebih rendah profilnya dalam dunia politik. Meski demikian, Fatmawati selalu mendukung pendidikan dan perkembangan anak-anaknya, memastikan mereka memahami pentingnya pengabdian kepada bangsa.\r\n\r\nNamun, kehidupan Fatmawati di masa-masa akhir tidak semulus yang diharapkan. Ia menghadapi masa-masa sulit setelah perpisahan dengan Soekarno pada tahun 1959. Pasca-perpisahan tersebut, Fatmawati memilih untuk tinggal di Jakarta dan melanjutkan kehidupannya dengan lebih fokus pada kegiatan sosial dan keluarga. \r\n\r\nFatmawati Soekarno meninggal pada 14 Mei 1980. Meski sudah tiada, warisan dan pengaruhnya tetap hidup dalam sejarah Indonesia. Ia dikenang sebagai simbol keberanian, ketangguhan, dan pengabdian seorang perempuan yang tidak hanya berdiri di belakang presiden, tetapi juga berdiri bersama rakyat dalam memperjuangkan nasib bangsa. Namanya selalu diingat dalam berbagai cerita perjuangan dan keabadian semangat kemerdekaan Indonesia.', 2);
