(17, 'Martha Christina Tiahahu', , 'Martha Christina Tiahahu adalah salah satu pahlawan nasional Indonesia yang dikenal sebagai simbol keberanian dan semangat perjuangan dalam melawan penjajahan Belanda di Maluku. Ia lahir pada 4 Januari 1800 di kawasan Maluku, yang pada masa itu berada di bawah kekuasaan penjajahan Belanda. Martha Christina Tiahahu berasal dari keluarga pejuang, di mana ayahnya, Kapitan Tiahahu, adalah seorang tokoh penting dalam perlawanan terhadap penjajah.\r\n\r\nMartha Christina Tiahahu menjadi terkenal karena keberaniannya dalam memimpin perlawanan rakyat Maluku melawan kekuasaan Belanda. Pada masa itu, Belanda sering memanfaatkan kekayaan alam Maluku, terutama rempah-rempah, dan menindas penduduk lokal. Perlawanan rakyat Maluku dipimpin oleh berbagai pemimpin lokal, dan Martha Christina Tiahahu adalah salah satu yang paling menonjol. Ia dikenal karena semangatnya yang tak kenal lelah, keuletan, dan keberaniannya dalam melawan penjajah, bahkan dalam situasi yang sangat sulit.\r\n\r\nPada usia muda, Martha Christina Tiahahu bergabung dengan ayahnya dan para pejuang lainnya dalam melakukan perlawanan. Ia berperan penting dalam mengorganisir dan memimpin serangan terhadap pasukan Belanda. Ia juga dikenal memiliki kemampuan berbicara yang fasih dalam menyuarakan semangat kemerdekaan dan membangkitkan semangat juang rakyat.\r\n\r\nSayangnya, perjuangan Martha Christina Tiahahu tidak berlangsung lama. Pada tahun 1817, ia ditangkap oleh pasukan Belanda setelah perlawanan sengit yang dilakukan di Pulau Seram. Martha Christina Tiahahu kemudian diasingkan ke Pulau Jawa dan dipenjarakan di Batavia (sekarang Jakarta). Di sana, ia menderita akibat kondisi penahanan yang buruk, serta tekanan yang diberikan oleh penjajah. Martha Christina Tiahahu meninggal pada usia 17 tahun di dalam penjara, pada 2 Januari 1818.\r\n\r\nMeskipun ia meninggal muda, perjuangan Martha Christina Tiahahu tetap dikenang dan dihormati sebagai simbol keberanian, semangat juang, dan dedikasi kepada tanah air. Pemerintah Indonesia mengakui jasa-jasanya dengan menganugerahi gelar pahlawan nasional pada tahun 2004. Nama Martha Christina Tiahahu terus dikenang sebagai contoh nyata dari perjuangan perempuan Indonesia dalam merebut kemerdekaan dan membela tanah air.', 2);
