(21, 'Sisingamangaraja XII', , 'Sultan Agung adalah salah satu raja terbesar dalam sejarah Kerajaan Mataram Islam, yang memerintah dari tahun 1613 hingga 1645. Ia dikenal sebagai pemimpin yang visioner, cerdas, dan memiliki ambisi besar untuk mengembalikan kejayaan kerajaan dan memperluas wilayah kekuasaan Mataram. Sultan Agung adalah penguasa yang memiliki pengaruh besar di Jawa dan dianggap sebagai salah satu pahlawan yang memperjuangkan kemerdekaan dan kedaulatan Indonesia, meskipun pada masa itu Indonesia belum terbentuk sebagai sebuah negara.\r\n\r\nSultan Agung lahir sekitar tahun 1593 dan merupakan putra dari Sultan Hanyokrowati, raja Mataram sebelumnya. Sejak muda, Sultan Agung sudah menunjukkan bakat kepemimpinan dan kemampuan dalam mengatur pemerintahan. Ketika ia naik tahta, ia segera melakukan reformasi di dalam negeri untuk memperkuat kekuasaan kerajaan. Salah satu langkah awalnya adalah memperkuat angkatan perang Mataram, yang menjadi kunci untuk memperluas pengaruh dan mempertahankan kekuasaan.\r\n\r\nSelama pemerintahannya, Sultan Agung berhasil memperluas wilayah Kerajaan Mataram hingga mencakup hampir seluruh pulau Jawa. Ia juga melakukan berbagai upaya untuk memperluas hubungan diplomatik dan perdagangan dengan negara-negara lain, termasuk negara-negara di Asia Tenggara dan India. Salah satu prestasi yang paling menonjol adalah ekspedisi militer yang dipimpin Sultan Agung untuk menyerang Batavia (sekarang Jakarta), yang saat itu dikuasai oleh Belanda. Ekspedisi ini bertujuan untuk mengusir Belanda dan menguasai daerah pesisir utara Jawa, yang sangat penting bagi perdagangan. Meskipun tidak berhasil menguasai Batavia sepenuhnya, pertempuran ini menunjukkan semangat juang Sultan Agung dalam melawan penjajahan Eropa.\r\n\r\nSultan Agung juga dikenal karena kebijakannya dalam memajukan bidang kebudayaan dan agama Islam. Ia memperkenalkan dan mempopulerkan ajaran Islam di wilayah kerajaannya dan mendirikan berbagai masjid serta lembaga keagamaan. Di bawah kepemimpinan Sultan Agung, Mataram mengalami masa keemasan dalam bidang seni, budaya, dan ilmu pengetahuan. Ia juga mempromosikan pembangunan infrastruktur, seperti jalan-jalan dan kanal, yang membantu meningkatkan perdagangan dan mobilitas di dalam kerajaan.\r\n\r\nMeskipun Sultan Agung dikenal sebagai pemimpin yang bijaksana, ia juga menghadapi tantangan besar, termasuk pemberontakan internal dan persaingan dengan penguasa lokal lainnya. Pada akhir masa pemerintahannya, Mataram mengalami masa-masa sulit karena konflik internal dan tekanan dari Belanda yang semakin kuat. Sultan Agung meninggal pada tahun 1645, dan setelah kematiannya, kerajaan Mataram mengalami perpecahan yang menyebabkan melemahnya kekuasaan kerajaan.\r\n\r\nWarisan Sultan Agung masih dikenang hingga saat ini sebagai simbol kepemimpinan yang kuat, semangat juang, dan upaya untuk mempertahankan kedaulatan bangsa. Ia dianggap sebagai pahlawan yang melawan penjajahan dan memperjuangkan kemerdekaan, meskipun masa itu berbeda jauh dari kemerdekaan Indonesia yang dicapai pada abad ke-20. Sultan Agung mengajarkan pentingnya persatuan dan kekuatan dalam mempertahankan negara dan bangsa, yang terus menginspirasi generasi-generasi berikutnya di tanah air.', 2),
(22, 'Hasan Basri', , 'Hasan Basri adalah seorang ulama besar dan tokoh agama yang dikenal luas di dunia Islam, khususnya di Indonesia. Ia lahir pada tahun 642 M di kota Bashrah, Irak, dan dikenal sebagai salah satu tokoh terkemuka dalam aliran tasawuf, yang menekankan pentingnya kedekatan dengan Tuhan melalui pengendalian diri dan pengabdian spiritual. Hasan Basri memiliki pengaruh besar dalam pengembangan ajaran tasawuf dan menjadi panutan bagi banyak umat Islam di seluruh dunia, termasuk di Indonesia.\r\n\r\nSejak muda, Hasan Basri menunjukkan kedalaman pengetahuan agama yang luar biasa dan ketaqwaan yang tinggi. Ia belajar langsung dari para ulama besar pada masanya dan mendalami berbagai ilmu agama, seperti tafsir Al-Quran, hadis, dan fiqh. Selain itu, Hasan Basri dikenal sebagai seorang yang sangat zuhud, yakni seseorang yang hidup sederhana dan menjauhkan diri dari kemewahan duniawi. Ia mengajarkan pentingnya nilai-nilai seperti kejujuran, kesederhanaan, dan ketulusan dalam beribadah.\r\n\r\nSalah satu ajaran penting dari Hasan Basri adalah tentang pentingnya keikhlasan dalam beribadah dan menjalani kehidupan. Ia sering mengingatkan umat Islam agar tidak hanya melaksanakan ibadah secara lahiriah, tetapi juga harus disertai dengan niat yang tulus dan ikhlas. Menurut Hasan Basri, keberhasilan dalam mendekatkan diri kepada Tuhan terletak pada bagaimana seseorang mengendalikan hawa nafsu, menahan diri dari godaan dunia, dan memfokuskan perhatian sepenuhnya kepada Allah.\r\n\r\nHasan Basri juga dikenal dengan kata-kata bijaknya yang penuh makna dan sering dijadikan inspirasi oleh para pengikutnya. Salah satu ungkapan terkenal dari Hasan Basri adalah, \"Janganlah engkau mengharapkan sesuatu dari dunia, karena dunia itu hanya sementara.\" Kalimat ini mengajarkan umat Islam untuk tidak terlalu terpikat oleh dunia dan harta benda, melainkan lebih fokus pada kehidupan spiritual dan hubungan dengan Tuhan.\r\n\r\nSelain itu, Hasan Basri juga dikenal karena kepeduliannya terhadap masyarakat dan kepekaan sosialnya. Ia tidak hanya mengajarkan ilmu agama, tetapi juga aktif dalam menasihati dan membantu orang-orang yang membutuhkan. Kehidupan Hasan Basri penuh dengan contoh-contoh kebaikan, keteladanan, dan perjuangan untuk meningkatkan kualitas spiritual umat Islam.\r\n\r\nHasan Basri meninggal pada tahun 728 M di Bashrah pada usia yang cukup lanjut. Meskipun ia sudah tiada, warisan ajaran dan pemikiran Hasan Basri tetap hidup hingga sekarang. Di Indonesia, ajarannya sering kali diadopsi oleh para ulama dan komunitas sufi sebagai pedoman dalam menjalani kehidupan yang lebih dekat dengan Tuhan. Hasan Basri tetap dikenang sebagai simbol ketulusan, kesederhanaan, dan pengabdian kepada Allah dalam tradisi Islam yang berkembang di berbagai belahan dunia.', 2);
INSERT INTO `data` (`iddata`, `nama`, `gambar`, `data`, `idkategori`) VALUES
(23, 'Ki Hajar Dewantara', , 'Ki Hajar Dewantara, lahir dengan nama Raden Mas Soewardi Soerjaningrat pada 2 Mei 1889 di Jogyakarta, adalah seorang tokoh pendidikan dan pahlawan nasional Indonesia yang sangat berpengaruh dalam perjuangan pendidikan di tanah air. Ia dikenal sebagai pelopor pendidikan nasional dan pendiri Taman Siswa, sebuah lembaga pendidikan yang berfokus pada pendidikan yang memerdekakan dan mengembangkan potensi anak-anak Indonesia, tanpa terikat pada sistem pendidikan kolonial yang dipaksakan oleh penjajah Belanda.\r\n\r\nKi Hajar Dewantara tumbuh dalam lingkungan keluarga bangsawan Jawa, namun ia memiliki semangat untuk memperjuangkan nasib rakyat dan memajukan pendidikan yang lebih merata. Setelah menyelesaikan pendidikan dasar, ia aktif dalam dunia pergerakan dan memperjuangkan hak-hak rakyat. Ia dikenal sebagai seorang intelektual, penulis, dan aktivis yang sangat peka terhadap kondisi sosial dan pendidikan di Indonesia pada masa itu.\r\n\r\nPada awalnya, Ki Hajar Dewantara dikenal sebagai seorang jurnalis dan penulis yang berbicara lantang tentang ketidakadilan yang dirasakan oleh rakyat Indonesia. Salah satu karyanya yang paling terkenal adalah artikel berjudul Als ik Eens Nederlander Was (Seandainya Saya Seorang Belanda), yang ditulisnya saat bekerja di surat kabar. Artikel tersebut mengkritik kebijakan pemerintah kolonial Belanda dan menyuarakan rasa tidak puas terhadap perlakuan terhadap rakyat pribumi. Akibat tulisan ini, Ki Hajar Dewantara dijatuhi hukuman bui oleh Belanda pada tahun 1913, tetapi ia tetap teguh dalam memperjuangkan prinsip-prinsip yang diyakininya.\r\n\r\nPada 1922, Ki Hajar Dewantara mendirikan Taman Siswa, yang menjadi cikal bakal gerakan pendidikan yang mengedepankan prinsip \"Ing Ngarsa Sung Tulada, Ing Madya Mangun Karsa, Tut Wuri Handayani.\" Prinsip ini memiliki makna mendalam: sebagai pemimpin, harus mampu memberikan teladan (Ing Ngarsa Sung Tulada); sebagai pembimbing, harus mampu membangkitkan semangat dan kemauan (Ing Madya Mangun Karsa); dan sebagai pengajar, harus mendukung dan memberikan dorongan dari belakang (Tut Wuri Handayani). Prinsip ini mengajarkan pentingnya peran pendidik dalam mendidik murid agar memiliki kemerdekaan dalam berpikir dan bertindak.\r\n\r\nKi Hajar Dewantara percaya bahwa pendidikan bukan hanya soal mengajarkan ilmu pengetahuan, tetapi juga membentuk karakter dan kepribadian bangsa. Taman Siswa berkembang menjadi lembaga pendidikan yang merangkul semangat kebangsaan dan menciptakan kesadaran akan identitas budaya dan nasional. Pendidikan di Taman Siswa tidak hanya mengajarkan pelajaran akademis, tetapi juga melibatkan seni, budaya, dan nilai-nilai moral yang penting bagi perkembangan pribadi dan kebangsaan.\r\n\r\nSelain berperan dalam bidang pendidikan, Ki Hajar Dewantara juga aktif dalam pergerakan kemerdekaan Indonesia. Ia mendukung perjuangan bangsa melalui berbagai organisasi dan selalu menekankan pentingnya persatuan dan kebangkitan rakyat Indonesia. Kiprahnya dalam memperjuangkan pendidikan dan kemerdekaan membuatnya dihormati sebagai tokoh penting dalam sejarah Indonesia.\r\n\r\nKi Hajar Dewantara wafat pada 26 April 1959. Sebagai penghormatan atas jasa-jasanya, pemerintah Indonesia mengabadikan tanggal 2 Mei sebagai Hari Pendidikan Nasional. Ki Hajar Dewantara tetap dikenang sebagai pahlawan pendidikan dan simbol perjuangan untuk mencerdaskan kehidupan bangsa. Prinsip-prinsipnya terus dipegang teguh oleh para pendidik dan masyarakat Indonesia, menjadikannya sebagai inspirasi bagi generasi penerus dalam mewujudkan pendidikan yang lebih baik dan merata.', 1),
(24, 'W.R. Supratman', , 'W.R. Supratman, atau Wage Rudolf Supratman, adalah seorang pahlawan nasional Indonesia yang dikenal sebagai pencipta lagu kebangsaan Indonesia, *Indonesia Raya*. Lahir pada 9 Maret 1903 di Somongari, Purworejo, Jawa Tengah, W.R. Supratman berasal dari keluarga yang memiliki latar belakang sederhana. Sejak muda, ia menunjukkan bakat di bidang musik dan seni, serta memiliki rasa cinta yang mendalam terhadap tanah air.\r\n\r\nW.R. Supratman belajar musik secara otodidak dan sering memperlihatkan kemampuan dalam bermain alat musik, seperti biola. Ia mulai terlibat dalam dunia seni pertunjukan dan aktif dalam berbagai organisasi yang memperjuangkan kebudayaan dan kemerdekaan Indonesia. Ia juga memiliki jiwa nasionalisme yang tinggi dan senantiasa menggalang semangat perjuangan di tengah masyarakat.\r\n\r\nPada 1928, W.R. Supratman menciptakan lagu *Indonesia Raya* sebagai bentuk ekspresi cinta dan semangat persatuan bangsa Indonesia. Lagu ini pertama kali diperkenalkan di hadapan publik pada Kongres Pemuda II di Jakarta pada 28 Oktober 1928, yang juga merupakan hari bersejarah di mana Sumpah Pemuda diikrarkan. *Indonesia Raya* segera menjadi simbol perjuangan kemerdekaan dan mengobarkan semangat persatuan di kalangan rakyat Indonesia. Melodi dan liriknya yang penuh semangat mengingatkan rakyat Indonesia akan pentingnya bersatu dalam menghadapi penjajahan dan berjuang untuk merdeka.\r\n\r\nSebagai pencipta lagu kebangsaan, W.R. Supratman harus menghadapi berbagai tantangan, termasuk pengawasan dari pemerintah kolonial Belanda. Ia bahkan pernah ditangkap oleh pihak berwenang karena terlibat dalam kegiatan yang dianggap subversif oleh penjajah. Meskipun demikian, semangat perjuangannya tidak pernah surut. Ia terus memperjuangkan kebebasan dan persatuan Indonesia hingga akhir hayatnya.\r\n\r\nW.R. Supratman meninggal dunia pada 17 Agustus 1938 dalam usia yang relatif muda, tepat pada hari ulang tahun kemerdekaan Indonesia yang ke-63. Ia meninggal dalam keadaan miskin, namun warisan karya-karyanya tetap hidup dalam ingatan bangsa Indonesia. Lagu *Indonesia Raya* diresmikan sebagai lagu kebangsaan Indonesia setelah kemerdekaan pada tahun 1945, dan kini menjadi simbol kebanggaan dan semangat nasionalisme bagi seluruh rakyat Indonesia.\r\n\r\nAtas jasa-jasanya yang sangat besar dalam menginspirasi pergerakan kemerdekaan, W.R. Supratman dianugerahi gelar pahlawan nasional oleh pemerintah Indonesia. Namanya tetap dikenang sebagai salah satu pahlawan yang berjasa dalam mengangkat semangat persatuan dan kebangsaan, serta menjadi simbol cinta tanah air yang abadi.', 2),
(25, 'Haji Agus Salim', , 'Haji Agus Salim adalah salah satu tokoh penting dalam sejarah pergerakan kemerdekaan Indonesia dan seorang pahlawan nasional yang dikenal sebagai diplomat ulung, jurnalis, dan cendekiawan. Lahir dengan nama lengkap Agus Salim pada 8 Oktober 1884 di Koto Gadang, Sumatera Barat, Haji Agus Salim berasal dari keluarga Minangkabau yang memiliki latar belakang pendidikan yang tinggi. Sejak muda, Haji Agus Salim sudah menunjukkan minatnya pada pendidikan dan intelektualitas, serta terlibat dalam aktivitas-aktivitas pergerakan untuk memperjuangkan kemerdekaan Indonesia.\r\n\r\nHaji Agus Salim mendapatkan pendidikan formal di sekolah-sekolah Belanda dan kemudian melanjutkan studi di berbagai lembaga pendidikan, sehingga ia menguasai bahasa Belanda, Arab, Inggris, dan bahasa-bahasa lainnya. Kemampuan berbahasa yang luar biasa ini membuatnya menjadi sosok yang dihormati dalam dunia pergerakan kemerdekaan, di mana ia berperan penting sebagai juru bicara dan perunding dalam berbagai forum. Haji Agus Salim dikenal sebagai orator ulung dan penulis yang sangat berpengaruh, yang sering mengartikulasikan aspirasi rakyat Indonesia melalui tulisannya.\r\n\r\nSalah satu kontribusi terbesar Haji Agus Salim dalam pergerakan kemerdekaan adalah peranannya sebagai diplomat dan pengurus dalam organisasi-organisasi pergerakan, seperti Sarekat Islam (SI) dan kemudian Partai Serikat Islam Indonesia (PSII). Ia memiliki semangat kebangsaan yang tinggi dan memperjuangkan persatuan antar berbagai etnis dan agama di Indonesia, menekankan pentingnya kerjasama untuk mencapai tujuan bersama, yaitu kemerdekaan dari penjajahan Belanda.\r\n\r\nHaji Agus Salim juga aktif dalam forum-forum internasional, seperti Kongres Asia-Afrika di Bandung pada tahun 1955. Ia berperan dalam memperkenalkan Indonesia di kancah internasional dan membangun hubungan diplomatik yang penting dengan negara-negara lain. Keahliannya dalam berbahasa dan kemampuan diplomatiknya yang cerdas membuatnya menjadi sosok yang dihormati oleh para pemimpin dunia.\r\n\r\nSelain sebagai diplomat, Haji Agus Salim juga dikenal sebagai seorang jurnalis dan penulis. Ia menulis berbagai artikel dan opini yang mengkritik kebijakan kolonial Belanda dan mengadvokasi kemerdekaan Indonesia. Karya-karyanya memberikan wawasan yang mendalam tentang situasi politik dan sosial di Indonesia pada masa itu dan menjadi sumber inspirasi bagi pergerakan kemerdekaan.\r\n\r\nSetelah Indonesia merdeka, Haji Agus Salim menjabat sebagai Menteri Luar Negeri Indonesia pertama pada periode 19471948 dan memainkan peran penting dalam hubungan diplomatik negara. Ia dikenal dengan prinsip-prinsipnya yang tegas dan kebijaksanaannya dalam memajukan kepentingan negara. Ia juga sering menekankan pentingnya kesederhanaan dan integritas dalam menjalankan tugas sebagai pejabat negara.\r\n\r\nHaji Agus Salim meninggal dunia pada 4 November 1954 di Jakarta dalam usia 70 tahun. Sebagai penghormatan atas jasanya, pemerintah Indonesia menganugerahi gelar pahlawan nasional pada tahun 1961. Haji Agus Salim tetap dikenang sebagai seorang pahlawan yang memiliki integritas tinggi, berjiwa besar, dan berdedikasi untuk membela kemerdekaan serta mengangkat martabat bangsa Indonesia. Prinsip-prinsipnya dalam kebangsaan, diplomasi, dan integritas terus menginspirasi generasi-generasi penerus dalam membangun bangsa.', 2);
